drop table level;

CREATE TABLE IF NOT EXISTS level (
    `level` INT,
    `nama` VARCHAR(26) CHARACTER SET utf8
);

CREATE TABLE IF NOT EXISTS kode_prov (
    `kode_prov` INT,
    `nama` VARCHAR(20) CHARACTER SET utf8
);


CREATE TABLE IF NOT EXISTS kode_satker (
    `kode_satker` INT,
    `nama` VARCHAR(33) CHARACTER SET utf8,
    `kode_prov` INT
);


CREATE TABLE IF NOT EXISTS imkb_satker (
    `kode_satker` INT,
    `kode_prov` INT,
    `tahun` INT,
    `pcscore_aset` NUMERIC(17, 16),
    `pcscore_sumberdaya` NUMERIC(10, 9),
    `pcscore_pemulihan` NUMERIC(10, 9),
    `pcscore_rencana_darurat` NUMERIC(10, 9),
    `z_aset` NUMERIC(18, 17),
    `z_sumberdaya` NUMERIC(19, 18),
    `z_pemulihan` NUMERIC(19, 18),
    `z_rencanadarurat` NUMERIC(18, 17),
    `spss_aset` NUMERIC(6, 5),
    `spss_sumberdaya` NUMERIC(6, 5),
    `spss_pemulihan` NUMERIC(6, 5),
    `spss_rencanadarurat` NUMERIC(6, 5),
    `standar_aset` NUMERIC(18, 17),
    `standar_sumberdaya` NUMERIC(19, 18),
    `standar_pemulihan` NUMERIC(19, 18),
    `standar_rencanadarurat` NUMERIC(18, 17),
    `minimax_aset` NUMERIC(18, 15),
    `minimax_sumberdaya` NUMERIC(18, 15),
    `minimax_pemulihan` NUMERIC(18, 15),
    `minimax_rencanadarurat` NUMERIC(18, 15),
    `imkb` NUMERIC(17, 15)
);


CREATE TABLE IF NOT EXISTS imkb_pegawai (
    `kode_satker` INT,
    `kode_prov` INT,
    `level` INT,
    `tahun` INT,
    `nama` VARCHAR(40) CHARACTER SET utf8,
    `pcscore_pengetahuan` NUMERIC(19, 17),
    `pcscore_sumberdaya` INT,
    `pcscore_rencanadarurat` NUMERIC(10, 9),
    `z_pengetahuan` NUMERIC(21, 20),
    `z_sumberdaya` NUMERIC(18, 17),
    `z_rencanadarurat` NUMERIC(19, 18),
    `spss_pengetahuan` NUMERIC(8, 5),
    `spss_sumberdaya` INT,
    `spss_rencanadarurat` NUMERIC(6, 5),
    `standar_pengetahuan` NUMERIC(21, 20),
    `standar_sumberdaya` NUMERIC(18, 17),
    `standar_rencanadarurat` NUMERIC(19, 18),
    `minimax_pengetahuan` NUMERIC(19, 16),
    `minimax_sumberdaya` NUMERIC(18, 15),
    `minimax_rencanadarurat` NUMERIC(18, 15),
    `imkb` NUMERIC(18, 16)
);
